-- FAQ
insert into faq(question, answer) values ("트래블온에서는 어떤 서비스를 제공받을 수 있나요?","TRAVEL-ON은 혼자 여행을 온 여행객을 위한 여행지 내 화상 만남 서비스입니다. 여행 지역 내 화상 만남을 통하여 여행객 간의 정보 공유가 가능하고, 다른 여행객과의 약속을 잡거나 일정을 공유할 수도 있습니다. 해당 기능 외에도 다양한 기능들을 제공하오니 서비스를 이용하며 하나하나 알아갈 수 있기를 바랍니다.
");
insert into faq(question, answer) values ("위치 인증이 되지 않습니다.","크롬 웹사이트 위치 정보 허용이 설정되어있는지 확인하세요. 문제가 계속될 시 QnA 게시판을 이용해 관리자에게 문의하세요.");
insert into faq(question, answer) values ("여행 업적은 어떻게 하면 쌓을 수 있나요?","해당 지역에 가서 사이트 내 제공하는 위치인증을 실시하면 자동으로 여행 횟수가 증가하고 업적에 맞는 여행 횟수를 채울 시 업적이 증가합니다.");
insert into faq(question, answer) values ("지역 내 매칭이 아닌 다른 지역에 친구들과는 만날 수 없는건가요?","매칭 방에 입장 시 해당 방에 대한 초대 코드가 제공되며, 초대 코드를 이용하여 타지의 인원도 초대가 가능합니다.");
insert into faq(question, answer) values ("칭호 설정은 어디서 할 수 있는 건가요?","마이페이지에 들어가면 칭호 설정 페이지가 존재하며, 원하는 칭호를 설정하거나 해제가 가능합니다.");
insert into faq(question, answer) values ("매칭 방에서 불쾌한 사용자를 만났습니다.","매칭 방에 존재하는 신고기능이 존재하며 해당 인원에 대한 신고와 사유를 적어주시면 관리자가 내용을 검수하여 제제를 가합니다.");
insert into faq(question, answer) values ("여행 플래너는 어떻게 활용이 가능한가요?","여행플래너는 본인이 다녀온 지역에 대한 정보를 작성하거나, 가고 싶은 장소들을 작성이 가능합니다. 해당 정보들은 여행플래너에서 열람이 가능하며, 매칭 방에서도 서로 간의 여행 플래너를 확인하고 공유할 수 있습니다.");

